{

	viewMgr.visBBoxTop = 8.251856;

}

function load ()
{

	{

		var pageIndex = parent.PageIndexFromID (pageID);

}

function unload()
{
	if(isUpLevel)
	{
		viewMgr = null;
		parent.viewMgr = null;
	}
}

window.onload = load;
window.onunload = unload;
document.onclick = clickMenu;

</script>
